import React from 'react';
import './App.css';
import { BrowserRouter, Route } from "react-router-dom";
import { HomePage } from './pages/home'
import { HomeFeaturesPage } from './pages/homeFeatures'
import { DVPNHomePage } from './pages/dVPNHome'
import { CosmosPage } from './pages/cosmos'
import { FirstDAPP } from './pages/firstDapp';
import { BuildingDAPP } from './pages/buildingDapp'
import { SentinelPage } from './pages/sentinel'
import { DVPNFeaturesPage } from './pages/dVPNFeatures'
import { CompaniesPage } from './pages/companies'
import { ContactUsPage } from './pages/contactUs'
import FooterSection  from './components/footer'

function App() {
  return (
    <div className="App">
      <router>
      <Route path="/">

      </Route>

      <Route path="/dVPN">

      </Route>
      </router>



    </div>
  );
}

export default App;

export class MainLandingPage extends Component {
  constructor(props) {
      super(props)

  }

  render() {
    return (
      <div className="App">
        <HomePage />
        <HomeFeaturesPage />
        <CosmosPage />
        <FirstDAPP />
        <BuildingDAPP />
        <CompaniesPage />
        <ContactUsPage />
        <FooterSection />
      </div>
    );
  }
}

export class DVPNLandingPage extends Component {
  constructor(props) {
      super(props)

  }

  render() {
    return (
      <div className="App">
        <HomePage />
        <HomeFeaturesPage />
        <CosmosPage />
        <FirstDAPP />
        <BuildingDAPP />
        <CompaniesPage />
        <ContactUsPage />
        <FooterSection />
      </div>
    );
  }
}
